import React from 'react';
import { Link } from 'react-router-dom';
import './BankLayouts.css';
import { FaBank } from 'react-icons/fa';  // Importe o ícone do banco que você deseja usar

const BankLayouts = () => {
  // Suponha que os dados podem ser carregados de uma API ou definidos aqui
  const layouts = [
    { id: 1, name: 'Banco do Brasil', type: 'CNAB', icon: <FaBank /> },
    { id: 2, name: 'Caixa Econômica', type: 'CNAB', icon: <FaBank /> },
    { id: 3, name: 'Itaú', type: 'CNAB', icon: <FaBank /> },
    // Adicione mais bancos conforme necessário
  ];

  return (
    <div className="bank-layouts">
      <h1>Layouts dos Bancos</h1>
      <ul>
        {layouts.map(layout => (
          <li key={layout.id}>
            <div className="bank-info">
              {layout.icon}
              <span>{layout.name} - {layout.type}</span>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default BankLayouts;
